#include "../render.h"
#include "../../globals.h"
#include "../../helpers/imdraw.h"







namespace render
{
	namespace menu
	{

		const auto old_style_state = settings::visuals::newstyle;

		int repeat = 1;



		void menuchange_tab()
		{
			ImVec2 title_size;
			title_size = ImGui::CalcTextSize("PiplupWare");


			child(___("Menu Color Changer", u8""), []()
				{

					separator("General");
					ColorEdit4(___("Background", u8""), &settings::visuals::menucolor);
					ColorEdit4(___("Text", u8""), &settings::visuals::textcolor);

					separator("Header");

					ColorEdit4(___("Background ", u8""), &settings::visuals::headercolor);
					ColorEdit4(___("Text ", u8""), &settings::visuals::buttontextcolor);
					ColorEdit4(___("Outline", u8""), &settings::visuals::buttonoutlinecolor);
					ColorEdit4(___("Selected", u8""), &settings::visuals::buttonselectedcolor);
					ColorEdit4(___("Hover", u8""), &settings::visuals::buttonhovercolor);

					separator("Check button");

					ColorEdit4(___("Unselected", u8""), &settings::visuals::checkmarkcolor);
					ColorEdit4(___("Hover ", u8""), &settings::visuals::checkmarkhovercolor);
					ColorEdit4(___("Ticked", u8""), &settings::visuals::checkmarkactivecolor);

					separator("Slider");

					ColorEdit4(___("Background  ", u8""), &settings::visuals::sliderbgcolor);
					ColorEdit4(___("Hover  ", u8""), &settings::visuals::sliderhovercolor);
					ColorEdit4(___("Filled", u8""), &settings::visuals::slideractivecolor);

					ImGui::Separator();

					if (ImGui::Button(___("Load", u8"���������"), ImVec2(ImGui::GetContentRegionAvailWidth(), 24.f)))
					{
						imdraw::apply_style(old_style_state);

					}
				});
			ImGui::NextColumn();

			ImGui::NextColumn();

			child(___("Visual Test", u8""), []()
				{

					separator("Check button");

					checkbox("", u8"", &settings::esp::testt);

					separator("Slider");
					ImGui::SliderFloatLeftAligned("", &settings::visuals::test, 5.f, 10.f, "%.1f");

					ImGui::Separator();

					});
		}
	}
}






























































































